import React from 'react';

const FragmentLayout = () => {
  return (
    <>
      <header>
        <h1>Fragment Layout</h1>
      </header>
      <main>
        <p>This layout uses React fragments.</p>
      </main>
      <footer>
        <p>Copyright 2025</p>
      </footer>
    </>
  );
};

export default FragmentLayout;
